import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <table id="tablePreview" class="table table-sm table-borderless">
      <tbody>
        <tr>
          <td>{data.name}</td>
        </tr>
        <tr>
          <td>{data.desc}</td>
        </tr>
        <tr>
          <th scope="row">3</th>
          <td>Larry</td>
          <td>the Bird</td>
          <td>@twitter</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
      </tbody>
    </table>

  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
